INSERT INTO `settings` (`id`, `name`, `value`, `nice_name`, `description`) VALUES (2,'email_template_user_notification','<p>Dear ::name::,</p>\n\n<p>Your work order was registered and will be looked upon shortly.</p>\n\n<p>>Thank You</p>\n\n<p>Regards,<br>\nTrinity Support</p>','Basic user notification','Variables - ::name:: First and last name combination'),(3,'email_template_admin_notification','<p>Dear ::username::</p>\n\n<p>::first_name:: ::last_name:: Added a work order.\nPlease review!</p>\n\n<p>Regards<br>\nTrinity Support</p>','Admin Notification','Variables: ::username:: - admin username; ::first_name:: - the first name of the user; ::last_name:: - the last name of the user'),(4,'email_template_registration','<p>Dear ::username::</p>\n\n<p>Your registration was successfull.</p>\n\n<p>Regards,<br>\nTrinity Support</p>','Registration Email Template','Variables: ::username:: - username'),(5,'email_template_recovery_password','<p>Dear ::username::</p>\n\n<p>Reset your password by following this link: \n<a href=::resetpw_link::>::resetpw_link::</a></p>\n\n<p>Regards,<br>\nTrinity Support</p>','Password Recovery Email Template','Variables: ::username:: - username, ::resetpw_link:: - recovery URL'),(6,'email_template_workorder_created','<p>Dear ::username::</p>\n\n<p>Your workorder was submitted.</p>\n\n<p>Regards,<br>\nTrinity Support</p>','Work Order Submit Notification Email Template','Variables: ::username:: - client username'),(7,'email_template_message_for_client','<p>Dear ::username::</p>\n\n<p>You have received a message related to your submitted work order.<br>\n\nThe message is:<br>\n\n<strong>::message::</strong>\n</p>\n\n<p>Regards,<br>\nTrinity Support</p>','Work Order Message for Client Email Template','Variables: ::username:: - client`s username, ::message:: - the message'),(8,'email_template_workorder_scheduled','<p>Dear ::username::</p>\n\n<p>The status of your workorder was changed for Scheduled.</p>\n\n<p>Date when the inspection will be taken: 